import React from "react";
import { useEffect } from "react";
import { useState } from "react";
import "./Table.css";
const Table = () => {
  const [allPost, setAllPost] = useState([]);
  useEffect(() => {
    fetch("http://localhost:3003/posts")
      .then((res) => {
        return res.json();
      })
      .then((postData) => {
        
        setAllPost(postData);
        
      });
  }, []);
  return (
    <>
    <div className="a2">
    <input placeholder="PPP ID" className="PPPID"></input>
              <img src="search1.jpeg" className="i1"></img>
              <a href="/p1">
                <button className="btn3">Add property</button>
              </a>
              </div>
              <div className="body">
              <table className="Table">
                <tr className="inside table">
                  <th >PPP ID</th>
                  <th >Image</th>
                  <th >Property</th>
                  <th >contact</th>
                  <th >Area</th>
                  <th >views</th>
                  <th >status</th>
                  <th >Days left</th>
                  <th >Action</th>
                </tr>
              </table>
            </div>
    <div>
      {allPost.map((ele) => {
        return (
            <div className="body">
              <table className="Table">
                <tr className="inside table">
                  <td className="cell">{parseInt(Math.random() * 10000)}</td>
                  <td className="cell"><img alt="img"></img></td>
                  <td className="cell">{ele.PropertyType}</td>
                  <td className="cell">{ele.mobile}</td>
                  <td className="cell">{ele.Area}</td>
                  <td className="cell">{ele.Facing}</td>
                  <td className="cell">{ele.Ownership}</td>
                  <td className="cell">{parseInt(Math.random() * 100)}</td>
                  <td className="cell">Action</td>
                </tr>
              </table>
            </div>
        );
      })}
    </div>
    </>
  );
};

export default Table;
